import React from 'react'
import { useState } from 'react'

const Header = () => {
    const [count, setCount] = useState(0)
    const [item, setItem] = useState([
      {
        id:1,
        checked:false,
        details: 'i am a boy'
      },
      {
        id:2,
        checked:false,
        details: 'i am a girl'
      },
      {
        id:3,
        checked:false,
        details: 'i am a boygirl'
      }
    ])
  return (
    <>
        <p>{count}</p>
        <p>{item}</p>
    </>
  )
}

export default Header
